import React from 'react';

const TrackSearchResult = ({playingTrack, chooseTrack, lyrics}) => {

    function handlePlay(){
        chooseTrack(playingTrack)
    }

    console.log("Track: ", playingTrack)    
    console.log("Lyrics: ", lyrics)

    return (
        <div
          className="d-flex m-2 align-items-center"
          style={{ cursor: "pointer" }}
          onClick={handlePlay}
        >
          <img src={playingTrack.albumUrl} alt="" style={{ height: "64px", width: "64px" }} />
          <div className="ml-3">
            <div>{playingTrack.title}</div>
            <div className="text-muted">{playingTrack.artist}</div>
          </div>
        </div>
      )
};

export default TrackSearchResult;
